window.bookSummaryJSON = "<p>After being saved from annihilation by the Old Gator's daring plan, Gabriel and the crew of the <i>Magellan</i> find themselves in the most unlikely of places: a captured enemy starship. While learning to control the alien vessel introduces a new set of challenges, the secrets they discover within may prove to be the edge they so desperately need. </p> <p>With the rebellion on Earth rushing headlong toward a final, last-ditch battle and the remainder of the alien armada standing between them and home, it will take all of their strength, courage, and ingenuity to destroy the enemy once and for all. </p> <p>Before the enemy destroys them. </p> <p><i>Tides of War</i> is the third and final book in the science-fiction Rebellion trilogy. </p>"; 
